import React from "react";
import Index from "./pages/Oglasi";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/oglasi" element={<Index />}></Route>
            </Routes>
        </BrowserRouter>
    )
}

export default App
